import React from 'react';

function Contact(): JSX.Element {
  return (
    <div className="max-w-3xl mx-auto py-16 px-4 sm:px-6 lg:px-8 fade-in">
      <h1 className="text-3xl font-bold mb-4">Contact Us</h1>
      <p className="text-gray-700 mb-6">Reach out for more information or personalized assistance.</p>
      <form className="space-y-4">
        <input className="w-full border rounded px-3 py-2" placeholder="Your name" />
        <input className="w-full border rounded px-3 py-2" placeholder="Email" />
        <textarea className="w-full border rounded px-3 py-2" rows={4} placeholder="Message" />
        <button className="bg-blue-600 text-white px-4 py-2 rounded">Send Message</button>
      </form>
    </div>
  );
}

export default Contact;
